package main

import "fmt"

func existsInMap(ch byte, hsh map[byte]int) bool {
    _, ok := hsh[ch]
    return ok
}

func areEqualMaps(hsh1, hsh2 map[byte]int) bool {
    for k, v := range hsh1 {
        if !existsInMap(k, hsh2) || v != hsh2[k] {
            return false
        }
    }
    for k, v := range hsh2 {
        if !existsInMap(k, hsh1) || v != hsh1[k] {
            return false
        }
    }
    return true
}

func checkInclusion(s1 string, s2 string) bool {
    N, M := len(s1), len(s2)
    cntr1 := make(map[byte]int)
    for _, v := range s1 {
        cntr1[byte(v)]++
    }
    for i := 0; i < M; i++ {
        if existsInMap(s2[i], cntr1) {
            cntr2 := make(map[byte]int)
            for j := i; j < i + N; j++ {
                if j >= M {
                    break
                }
                if existsInMap(s2[j], cntr1) {
                    cntr2[byte(s2[j])]++
                    if cntr2[s2[j]] > cntr1[s2[j]] {
                        break
                    }
                }
            }
            if areEqualMaps(cntr1, cntr2) {
                return true
            }
        }
    }
    return false
}

func main() {
    data := [][]string {
                //[]string{"ab", "eidbaooo"},
                //[]string{"ab", "eidboaoo"},
                //[]string{"ab", ""},
                //[]string{"", ""},
                []string{"", ""},
            }
    for _, v := range data {
        s1, s2 := v[0], v[1]
        fmt.Printf("s1, s2 = %s, %s\n", s1, s2)
        r := checkInclusion(s1, s2)
        fmt.Printf("r = %v\n", r)
        fmt.Println("=====================")
    }
}


